import React, { Component } from 'react';
import '../App.css';
import About from '../components/About';
import Skills from '../components/Skills';


class App extends Component {

render() {
return (
    <main>
      <div className="App"> 
        <div className='About'>
          <About />
        </div>

        <div className='Skills'>
            <Header header="skills"/>
            <Skills />
        </div>
    </div>
  </main>
  );
}
}
export default App;
